import React, { Component } from 'react';

import './App.css';
import { render } from '@testing-library/react';

class App extends Component {
  constructor(props) {
    super(props);
    console.log("This is my initializer")


  }


  render() {
    return (
      <div className="App">
        <table className = "titleBar">
          <tbody>
            <tr>
              <td width = "8">
                <img alt = "app icon" width = "100" src = "DSC01148.JPG"/>
              </td>
              <h1>
                Favorite Movies
              </h1>
            </tr>
          </tbody>
        </table>


        <input style = {{
          fontSize: 24,
          display: 'block',
          width: "99%",
          paddingTop: 8,
          paddingBottom: 8,
          paddingLeft: 16
      }}placeholder = "Enter movie title..."/>


      </div>
    );
  }
}

export default App;
